(29318, '3CB61464-DF77-4C26-B208-8137C8D0669E', 'I‚Äôm really disturbed by these articles.  I think it is increasingly untenable to be someone committed to social justice and a Facebook user without compromising one‚Äôs values. I‚Äôm no longer sure Facebook is any better than fox. While Fox News is a more flagrant state media tool that creates an alternative reality. Facebook allows through narrowcasting with its proprietary, secret algorithms, a Kaleidoscope of realities created essentially to target and influence  people. It works...which is why people pay for it. They are being used as a propaganda engine and Zuckerberg doesn‚Äôt believe that he/they should take any responsibility for the impact of  of the platform. ...I‚Äôd say misuse of the platform, but really it isn‚Äôt misuse...it is the intended purpose of Facebook to modify behavior and make money. I think it is time for people to no longer participate and support Facebook. They are a malignancy and don‚Äôt deserve our participation.  ', '593672745539671168', 'None', 1, 'David', 'Nitzan', 0, '', '', '', 'iMessage', 'e:nwdave@b-zb.com', 'David', '2019-10-24T22:05:45.539671'),
